import React from 'react'
import {NavLink} from "react-router-dom";
import classes from './Nav.module.css'


const Nav = () =>{
	return <nav>
		<div>Menu</div>
        <div className={classes.Link}><NavLink to="/cart" activeClassName={classes.activeLink}><div className={classes.Linkdiv}>About</div></NavLink></div>
        
	</nav>
}

export default Nav
